
-- Table: evaluation_task
DROP TABLE IF EXISTS evaluation_task CASCADE;
CREATE TABLE evaluation_task (
    id text NOT NULL,
    evaluation_id text NOT NULL,
    task_id text NOT NULL,
    PRIMARY KEY (id)
);


-- Table: benchmark_task
DROP TABLE IF EXISTS benchmark_task CASCADE;
CREATE TABLE benchmark_task (
    id text NOT NULL,
    benchmark_id text NOT NULL,
    task_id text NOT NULL,
    PRIMARY KEY (id)
);


-- Table: evaluation
DROP TABLE IF EXISTS evaluation CASCADE;
CREATE TABLE evaluation (
    id text NOT NULL,
    user_id text NOT NULL,
    model_id text NOT NULL,
    status text NOT NULL DEFAULT 'queued'::text,
    average_score real DEFAULT 0,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: benchmark
DROP TABLE IF EXISTS benchmark CASCADE;
CREATE TABLE benchmark (
    id text NOT NULL,
    waitlist boolean DEFAULT false,
    title json NOT NULL,
    description json NOT NULL,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: category
DROP TABLE IF EXISTS category CASCADE;
CREATE TABLE category (
    id text NOT NULL,
    name text NOT NULL,
    name_ar text,
    description text,
    benchmark_id text,
    PRIMARY KEY (id)
);


-- Table: user
DROP TABLE IF EXISTS user CASCADE;
CREATE TABLE user (
    id text NOT NULL,
    email text NOT NULL,
    display_name text,
    image_hash text,
    organization text,
    website text,
    email_verified boolean NOT NULL DEFAULT false,
    hashed_password text,
    role text NOT NULL DEFAULT 'user'::text,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: dataset_review
DROP TABLE IF EXISTS dataset_review CASCADE;
CREATE TABLE dataset_review (
    id text NOT NULL,
    dataset_id text NOT NULL,
    user_id text NOT NULL,
    status text NOT NULL,
    reason text,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: task
DROP TABLE IF EXISTS task CASCADE;
CREATE TABLE task (
    id text NOT NULL,
    category_id text NOT NULL,
    user_id text NOT NULL,
    name text NOT NULL,
    name_ar text,
    description text,
    status text NOT NULL DEFAULT 'pending_review'::text,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: dataset
DROP TABLE IF EXISTS dataset CASCADE;
CREATE TABLE dataset (
    id text NOT NULL,
    user_id text NOT NULL,
    task_id text NOT NULL,
    category_id text NOT NULL,
    gcs_path text NOT NULL,
    status text NOT NULL DEFAULT 'pending_review'::text,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: email
DROP TABLE IF EXISTS email CASCADE;
CREATE TABLE email (
    id text NOT NULL,
    email text NOT NULL,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: oauth
DROP TABLE IF EXISTS oauth CASCADE;
CREATE TABLE oauth (
    provider_id text NOT NULL,
    provider_user_id text NOT NULL,
    provider_username text,
    user_id text NOT NULL,
    PRIMARY KEY (provider_id, provider_user_id)
);


-- Table: session
DROP TABLE IF EXISTS session CASCADE;
CREATE TABLE session (
    id text NOT NULL,
    user_id text NOT NULL,
    expires_at timestamp with time zone NOT NULL,
    PRIMARY KEY (id)
);


-- Table: task_review
DROP TABLE IF EXISTS task_review CASCADE;
CREATE TABLE task_review (
    id text NOT NULL,
    task_id text NOT NULL,
    user_id text NOT NULL,
    status text NOT NULL,
    reason text,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: model
DROP TABLE IF EXISTS model CASCADE;
CREATE TABLE model (
    id text NOT NULL,
    model text NOT NULL,
    user_id text NOT NULL,
    model_url text,
    name text NOT NULL,
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    version integer NOT NULL DEFAULT 1,
    adapter text NOT NULL DEFAULT 'openai-chat-completions'::text,
    description text,
    secret text,
    parameters text,
    training_data text,
    paper_url text,
    open_source_model_url text,
    PRIMARY KEY (id)
);


-- Table: job
DROP TABLE IF EXISTS job CASCADE;
CREATE TABLE job (
    id text NOT NULL,
    build_id text,
    user_id text NOT NULL,
    evaluation_id text NOT NULL,
    category_id text,
    status text NOT NULL DEFAULT 'queued'::text,
    error text,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);


-- Table: result
DROP TABLE IF EXISTS result CASCADE;
CREATE TABLE result (
    id text NOT NULL,
    job_id text NOT NULL,
    user_id text NOT NULL,
    evaluation_id text NOT NULL,
    category_id text,
    task_id text NOT NULL,
    average_score real DEFAULT 0,
    results json DEFAULT '[]'::json,
    updated_at timestamp without time zone NOT NULL DEFAULT now(),
    created_at timestamp without time zone NOT NULL DEFAULT now(),
    PRIMARY KEY (id)
);

